    s = input()

    ones = 0
    zeros = 0

    for c in s:
        if c == '1':
            ones += 1
        else:
            zeros += 1

    min_val = 2 ** ones
    max_val = (2 ** n) - (2 ** zeros) + 1

    print(' '.join(map(str, range(min_val, max_val + 1))))


if __name__ == "__main__":
    t = 1
    for _ in range(t):
        solve()
